import React from 'react';

import Logo from '../../assets/images/logo.svg';

import './estilos.scss';

import { FaBeer } from 'react-icons/fa';

export function Header () {
    return (
    <>
        <header>
            <div className="logo">
                <img src={ Logo } />
                <input type="search" placeholder="Search"/>
            </div>
            <div className="actions">
                <span>{ FaBeer }</span>
                <span>2</span>
                <span>3</span>
            </div>
            <div className="profile">
                <span>1</span>
                <span>2</span>
                <span>3</span>
            </div>
        </header>
    </>
    )
}
